################ SHOW UI

def showUi(widget, app=None, clear=False, ontop=False):
    '''
    widget (QWidget): Instance of your widget class or class
    app (QApplication): application from main thread (use application()). Default = None
    clear (bool): remove exists window by objectName. Default = False
    ontop (bool): Always on top
    '''
    #check application
    if not app:
        app = application()
    if not isinstance(app, QApplication):
        app = application()

    #check widget
    if inspect.isclass(widget): #object not created
        window = widget()
    else:
        window = widget

    #remove if exists
    #need to object name
    if clear:
        clearUi(widget.objectName())

    # exec
    if isinstance(window, QMenu): #for menu
        action = window.exec_(QCursor().pos())
        return action

    elif isinstance(window, QDialog): #for dialog
        window.setWindowFlags(main.hqt.Qt.WindowStaysOnTopHint)
        setIcon(window)
        result = window.exec_()
        if 'getData' in dir(window):
            data = window.getData()
        else:
            data = None
        main.hqt.exec_(app, window)
        return result, data

    else: #for simple window
        if ontop:
            window.setWindowFlags(main.hqt.Qt.WindowStaysOnTopHint)
        setIcon(window)
        window.show()
        window.setFocus()
        main.hqt.exec_(app, window)
        return window



